import React from 'react'
import '../styles/article.css'

function Article({data}) {
    const date = data.date_of_publication.split('-').reverse().join('/')
    return (
        <a className="article-container" href={data.url} target="_blank" rel="noopener noreferrer">
            <div className="article-body">
                <div className="article-header">{data.headline}</div>
                <div className="article-info">
                    <div>{date}</div>
                    <div>{data.reports[0].locations[0]}</div>
                </div>
            </div>
            
        </a>
    )
}

export default Article;
